import React from 'react';
import PropTypes from 'prop-types';

const Button = () => {
    return (
        <button
            className='button'
        >
        </button>
    );
};

Button.propTypes = {
    type: PropTypes.string,
    clicked: PropTypes.func
};

export default Button;
